import{_ as e,o as t,c as a,O as o}from"./chunks/framework.9482e208.js";const u=JSON.parse('{"title":"§ 46.2-686 Portion of certain fees to be paid into special fund.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/46.2-686.md","filePath":"vacode/46.2-686.md"}'),r={name:"vacode/46.2-686.md"},i=o('<h1 id="§-46-2-686-portion-of-certain-fees-to-be-paid-into-special-fund" tabindex="-1">§ 46.2-686 Portion of certain fees to be paid into special fund. <a class="header-anchor" href="#§-46-2-686-portion-of-certain-fees-to-be-paid-into-special-fund" aria-label="Permalink to &quot;§ 46.2-686 Portion of certain fees to be paid into special fund.&quot;">​</a></h1><p>Except as provided in subdivision A 13 of § <a href="/vacode/46.2-694/">46.2-694</a> and § <a href="/vacode/46.2-703/">46.2-703</a>, an amount equal to 19.6 percent of the fees collected, after refunds, from the registration of motor vehicles, trailers, and semitrailers pursuant to this chapter shall be transferred from the special fund established by the provisions of § <a href="/vacode/46.2-206/">46.2-206</a> to a special fund in the state treasury to be used to meet the expenses of the Department.</p><p>1987, c. 696, § 46.1-157.2; 1989, c. 727; 2020, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?201+ful+CHAP1230" target="_blank" rel="noreferrer">1230</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?201+ful+CHAP1275" target="_blank" rel="noreferrer">1275</a>.</p>',3),n=[i];function s(c,f,d,p,l,_){return t(),a("div",null,n)}const m=e(r,[["render",s]]);export{u as __pageData,m as default};
